package ArrayQuestions;
import java.util.*;
public class Array1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int array[] = new int[10];
		Scanner sc = new Scanner(System.in);
		
		for(int i=0;i<10;i++) {
			array[i] = sc.nextInt();
			System.out.println(array[i]);
		}

	}

}
